import React, { Component } from "react";
import XRay from "react-js-x-ray";
import img1 from "../Assets/Images/img11.png";
import img2 from "../Assets/Images/img1.png";

class XrayConfigurator extends Component {
  render() {
    return (
      <XRay
        images={[img1, img2]}
        beyond={true}
        diameter={200}
        cursor={false}
        responsive={true}
        type={"circle"}
        backgroundColor={"#00AAFF"}
        resize={[
          {
            screen: 1199,
            diameter: 100,
          },
          {
            screen: 991,
            diameter: 50,
          },
        ]}
      />
    );
  }
}

export default XrayConfigurator;
